import React from 'react';
import './PopCheckboxesStyles.scss';

const PopCkeckBoxes = () => {
	return(
		<div class="container">
		  <input id="toggle1" type="checkbox" />
		  <label for="toggle1">Same Album</label>

		  <input id="toggle2" type="checkbox" />
		  <label for="toggle2">This Artiste</label>

		  <input id="toggle3" type="checkbox" />
		  <label for="toggle3">Genre</label>

		  <input id="toggle4" type="checkbox" />
		  <label for="toggle4">Year/Era</label>

		  <input id="toggle5" type="checkbox" />
		  <label for="toggle5">Associate Artiste</label>
		</div>
	);
}

export default PopCkeckBoxes;
